import './App.css';
import Counter from './Component/Counter';
import store from './app/store'
import { Provider } from 'react-redux'

function App() {
  return (
    <div >
      <Provider store={store} >
      <Counter/>
      </Provider>

    </div>
  );
}

export default App;
